import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer bg-dark py-3 text-center">
        <div className="container">
            <a href="https://github.com/Mitchgreene92">
                <span className="fab fa-github" />
            </a>
            <span>
               Mitch Greene 2020
            </span>                
        </div>
    </footer>
  );
}

export default Footer;
